import React from'react';
import yelplogo from '../img/yelp.png'; // with import
import weatherlogo from '../img/weather.png'; // with import


const Footer = () =>(

    <div className="footer">
            <ul>
                <li><p className="footer--text">Made With: </p></li>
                <li><a href="https://www.yelp.com"><img src={yelplogo} alt="gyelp logo" height="30" width="30"></img></a></li>
                <li><a href="https://openweathermap.org/"> <img src={weatherlogo} alt="weather api logo" height="30" width="30"></img></a></li>
            </ul>
    </div>

);



export default Footer;
